import React from "react";
import Profile from "../pages/profile";
import Proptypes from "prop-types";

const AppLayout = ({ childeren }) => {
  return (
    <div>
      <div>공통 메뉴</div>
      {childeren}
    </div>
  );
};

AppLayout.prototype = {
  children: Proptypes.node.isRequired,
};

export default AppLayout;
